import React, { useEffect, useState } from "react";

function GetProducts() {
    const [ products, setProducts ] = useState();

    useEffect(()=>{
        fetch('https://fakestoreapi.com/products')
            .then(response=>response.json())
            .then(data =>
                setProducts(data),
                console.log(products))
            

    },[products])
    
}
